script: |
  super -f text -I q5602.spq | sort > q5602.out

inputs:
  - name: q5602.spq
    data: |
      SELECT col1 + col0 + - cor0.col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( cor0.col1 ) NOT IN ( - col2 + + col0 );
  - name: tab1

outputs:
  - name: q5602.out
    data: |
      -25
      -3
      17
